Bug Title: Attach wait loop only recreates missing notification files if the entire notification directory has been deleted
Bug Description: Here's a test that demonstrates some interesting behaviour involving the Attach API. We'll use two small programs:
public class InfiniteSleep {
 public static void main (String args[]) throws Exception {
 Thread.sleep(Long.MAX_VALUE);
 }
}
public class JVMLister {
 public static void main(String[] args) {
 for (Object jvm : com.sun.tools.attach.VirtualMachine.list().toArray()) {
 System.out.println(jvm);
 }
 }
}
1. Compile and run InfiniteSleep
2. Compile and run JVMLister. Note that two JVMs are listed - the JVM running the JVMLister program, and the JVM running the InfiniteSleep program.
3. Delete the files in `/tmp/.com_ibm_tools_attach/[PID]`, where `[PID]` is the process ID for the JVM running the InfiniteSleep program.
4. Run JVMLister again. Only the JVM running the JVMLister program is listed.
5. Run JVMLister again. Both JVMs are listed again, as they were in step (2).
This happens because on step (4) the implementation of `com.sun.tools.attach.VirtualMachine.list()` notices the missing files in the PID subdirectory, interprets the directory as "stale", and cleans up by deleting the whole directory here:
Once the PID directory is deleted, the Attach wait loop in the JVM running the InfiniteSleep program quickly notices that it's missing and recreates the directory and the files within, here:
The problem is that this code in the Attach wait loop doesn't check for the scenario where the PID directory still exists, but the files within it have been deleted. Can this code be improved to check for the existence of the files in the directory as well as the directory itself, and then reconstruct the files if they are missing?

